import Home from './pages/Home/HomePage';
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import NavBar from './components/Utilty/NavBarLogin';
function App() {
  return (
    <div>
      <NavBar />
      <BrowserRouter>
        <Routes>
          <Route index element={<Home />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
